<div id="performance" class="section level3">
<h3>Performance</h3>
<p>Because ODEINT is a header-only library, the entire integration path is exposed to the compiler. That means your system functions can be inlined with the integration code, loops unrolled, etc. It will help if you enable optimization in your compiler. Use “-O3” with gcc. See the R documentation on the user Makevars file. (Odeintr now provides a convenient function to set the compiler optimization level.)</p>
<p>The Lorenz and Van der Pol examples above show about 10 million observer calls per second.</p>
</div>
